// 6. Realizar una funci\uFFFDn que calcule el factorial de un n\uFFFDmero ingresado por el usuario (el
// n\uFFFDmero no puede ser mayor de 10, realizar la validaci\uFFFDn). Mostrar el resultado por la
// consola.
function factorial(n){
    if(n>10){
        return "El numero no debe ser mayor a 10"
    }else if(n<=0 || n==1){
        return 1
    }else{
        return (n * factorial(n-1))
    }
}
